import React from "react";
import ReactDOM from "react-dom/client";
import MainBlock from "./components/MainBlock";
import reportWebVitals from "./reportWebVitals";
import "../src/css/main.css";
import AboutBlock from "./components/AboutBlock";
import FileServicesBlock from "./components/FileServicesBlock";
import ConsultationBlock from "./components/ConsultationBlock";
import OurStuff from "./components/OurStuff";
import OfferBlcok from "./components/OfferBlock";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <MainBlock />
    <AboutBlock />
    <FileServicesBlock />
    <ConsultationBlock />
    <OurStuff />
    <OfferBlock />
  </React.StrictMode>
);

reportWebVitals();
